import React, { useState } from 'react';
import { Form, Button, Alert } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import { useForm } from 'react-hook-form';
import { login } from '../auth';
import { useNavigate } from 'react-router-dom';
import "./Login.css";
import image1 from "../image.png";
import triple_clicked from "../triple_clicked.png"



const LoginPage = () => {
  const { register, handleSubmit, reset, formState: { errors } } = useForm();
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  const [isOpen, setIsOpen] = useState(false);

    const handleButtonClick = () => {
      setIsOpen(!isOpen);
    };

  const loginUser = (data) => {
    const requestOptions = {
      method: 'POST',
      headers: {
        'content-type': 'application/json'
      },
      body:JSON.stringify(data)
    };

    const res = fetch('/auth/login', requestOptions)
      .then(res => res.json())
      .then(data => {
        if (data) {
          console.log(data.data.access_token)
          localStorage.setItem('access_token', data.data.access_token)
          localStorage.setItem('refresh_token', data.data.refresh_token)
          login(data.data.access_token);
          navigate('/',  { state: { username: data.username } });
        } else {
          setError('Invalid username or password');
        }
      });

    reset();
  }

  return (
    <div className="login_main_div">
      <h1 className = {header}>Enhance AI</h1>
      <p className = {small_header}>Enhance images using AI</p>
      <div className={form_div}>
        {error && (
          <Alert variant="danger" onClose={() => setError(null)} dismissible>{error}</Alert>
        )}

        <h1 className={login_}>Login</h1>
        
        <form>
          <Form.Group>
            <Form.Control
              type="text" placeholder='  Username' className = {username}
              {...register("username", { required: true, maxLength: 25 })}
            />
          </Form.Group>
          {errors.username?.type === "required" && <p className={{ position : "fixed", color: "red", top : "47vh", left : "46.25vw" }}>Username is required</p>}
          {errors.username?.type === "maxLength" && <p className={{ position : "fixed", color: "red", top : "47vh", left : "45vw" }}>Max characters should be 25</p>}

          <Form.Group>
            <Form.Control
              type="password" placeholder='  Password' className = {password}
              {...register("password", { required: true, minLength: 8 })}
            />
          </Form.Group>
          {errors.password?.type === "required" && <p className={{ position : "fixed", color: "red", top : "55vh", left : "46.25vw" }}> Password is required</p>}
          {errors.password?.type === "minLength" && <p className={{ position : "fixed", color: "red", top : "55vh", left : "44.25vw"  }}>Minimum characters should be 8</p>}
          <br></br>

          <Form.Group>
            <Button as="sub" variant="primary" onClick={handleSubmit(loginUser)} className = "login_butt">
              <p className = {{position : "relative", top : "-0.75vh"}}>Login</p>
            </Button>
          </Form.Group>
          <br></br>
          <Form.Group>
            <small className = {{position : "fixed", top : "67vh", left : "43vw"}}>
              Do you already have an account?
              <Link className = "create" to="/signup">Create Account</Link>
            </small>
          </Form.Group>
        </form>
      </div>
      <div className = {img_container}>
        <img src = {image1} className = {img_style} alt = "robot_image"/>
      </div>
        <button className = "menu_button" onClick={handleButtonClick}><img className = {img_clicked} src = {triple_clicked} alt = "menu-button"></img></button>
      {isOpen && (<div className = {menu}>
        <button className = "menu_button_clicked" onClick={handleButtonClick}><img className = {img_clicked} src = {triple_clicked} alt = "menu-button"></img></button>
          <p className = {name}>Name</p>
          <p className = {name}>Home</p>
          <p className = {name}>Instructions</p>
      </div>)}
    </div>
  );
};

export default LoginPage;
